import {useState} from "react";
import './index.css'

function Button(){

    const [user,setUser] = useState([
        {name:'Igor',age:20,id:1},
        {name:'Nazar',age:30,id:2},
        {name:'Oleksandra',age:40,id:3},
        {name:'Igor',age:20,id:4},
        {name:'Nazar',age:30,id:5},
        {name:'Oleksandra',age:40,id:6},
    ])

    const final = (<div>
        {user.map((user)=> {
            return <div key={user.id}>
                <h2>{user.name}</h2>
                <p>{user.age}</p>
            </div>
        })}
    </div>)



    return final

}

export default Button;
